            "ب خێرهاتی! وەک بکارهێنەرەکێ مێڤان، تو دشێی ل گەلەک بەشێن ئەپی بگەڕێی بێی کو هەژمارەکێ دروست بکەی. تایبەتمەندی و سەلامەتیا تە بۆ مە گەلەک گرنگە. ئەڤ سیاسەتە ڕوون دکەت کا ئەم چەوا زانیاریان د ناڤ ئەپلیکەیشنێ دا کۆم دکەین، بکار دئینین، و دپارێزین.\n\n۱. ئەو زانیاریێن دبیت ئەم کۆم بکەین\n\nتەنانەت بێی خۆتۆمارکرنێ ژی، دبیت ئەپ هندەک داتایێن تەکنیکی یێن سنوردار کۆم بکەت وەک:\n\n- جۆرێ ئامێری، سیستەمێ کارپێکرنێ، و وەشانا ئەپی\n- چالاکیێن د ناڤ ئەپی دا (کلیک، ئەو لاپەرێن سەرەدانا وان هاتیە کرن، لێگەریان)\n- هەلبژارتنێن عەقاری یێن ل سەر مۆبایلێ هاتینە پاراستن (تەنێ ل سەر ئامێرێ تە دمینن)\n\nئەم چ وردەکاریێن کەسی وەک ناڤ، ئیمێل، یان ژمارا تەلەفۆنێ کۆم ناکەین هەتا ئەو دەمێ تو ب بریارا خۆ خۆ تۆمار دکەی.\n\n۲. چەوا ئەم داتایان بکار دئینین\n\nداتایێن کۆمکری هاریکاریا مە دکەن بۆ:\n\n- باشترکرنا ئەزموونا ئەپلیکەیشنی\n- چارەسەرکرنا ئاریشان و باشترکرنا کارکرنێ\n- نیشاندانا عەقارێن پەیوەندیدار و ئۆفیسێن نێزیک\n- بیرئینانا لیستەیا هیڤیان و هەلبژارتنان ل سەر ئامێرێ تە\n\n۳. وێنێن عەقاری و ناوەڕۆکا ئۆفیسێ\n\nئەگەر تو سەیری لیستێن عەقاری یان تشتێن ئۆفیسان بەلاڤکرین بکەی:\n\n- وێنە ژ سێرڤەرێن پاراستی دهێنە نیشاندان\n- ئەم دەستکاریێ د وێنان دا ناکەین یان شیکار ناکەین، ژبلی نیشاندانا وان د ئەپی دا\n- چ زانیاریێن کەسی ژ وێنان ناهێنە دەرێخستن\n\n٤. لیستەیا هیڤیان (Wishlist) و ئەمبارکرنا دەمکی\n\nوەک مێڤان:\n\n- تو دشێی عەقاران د لیستەیا هیڤیان دا بپارێزی، کو تەنێ ل سەر ئامێرێ تە دهێنە پاراستن\n- ئەگەر پاشی تە هەژمارەک دروست کر، سیستەم دێ پێشنیار کەت وان ڤەگوهێزیتە سەر پرۆفایلێ تە (ب ڕەزامەندیا تە)\n\n٥. بەلاڤکرنا داتایان\n\nئەم چ جاران:\n\n- داتایێن تە یێن کەسی نافرۆشین یان بەلاڤ ناکەین بۆ مەبەستێن مارکێتینگێ\n- تۆمارێن چالاکیا مێڤانان نادەینە لایەنێ سێیەم\n- وردەکاریێن پەیوەندیێن ئۆفیسێ بەلاڤ ناکەین ژبلی ئەوا ئۆفیس بخۆ د ئەپی دا بەلاڤ دکەت\n\nدبیت ئەم تەنێ داتایێن شیکاری یێن نەناسراو (Anonymous) بەکار بینین بۆ پێڤانا ڕەوشا گشتی یا بکارئینانا ئەپی.\n\n٦. پێڤەرێن ئاسایشێ\n\nبۆ پاراستنا داتایێن تە، ئەم ڤان ڕێکان بکار دئینین:\n\n- پەیوەندیێن کۆدکری (HTTPS)\n- ئەمبارکرنا پاراستی یا وێنان ب یاسایێن توند یێن دەسهەلاتێ\n- پشکنینا بەردەوام یا ئاساییشا سێرڤەری\n- سنوردارکرنا دەسهەلاتا گەهشتنە داتابەیسێ تەنێ بۆ گەشەپێدەرێن ڕێپێدای\n\n۷. لینکێن دەرەکی\n\nدبیت ئەپ لینکێن تێدا هەبن بۆ:\n\n- وێبسایتێن ئۆفیسان\n- نەخشە یان دوگمێن پەیوەندیێ\n\nڤەکرنا ڤان خزمەتگوزاریان دێ ل دویڤ سیاسەتا وان یا تایبەتمەندیێ بیت. ئەم بەرپرسیار نینین ژ وێ داتایا ل دەرڤەی ئەپی مامەلە پێ دهێتە کرن.\n\n۸. مافێن تە\n\nتو دشێی:\n\n- ب سەلامەتی بگەڕێی بێی کو چاڤدێری ل سەر تە هەبیت\n- هەر دەمەکێ تە بڤێت لیستەیا هیڤیان ژ ئەپی ژێ ببەی\n- بڕیارێ بدەی چ داتایێن کەسی نەدەی هەتا دەمێ خۆتۆمارکرنێ\n\n۹. ڕەزامەندی\n\nب بکارئینانا ئەپی، تو ڕازی دبی کو:\n\n- داتایێن گەڕانا مێڤانان ب شێوەیەکێ نەناسراو دهێنە کۆمکرن\n- داتایێن لیستەیا هیڤیان تەنێ ل سەر ئامێرێ تە دهێنە پاراستن\n\n۱۰. نووی کاریێن ڤێ سیاسەتێ\n\nدبیت ئەم ڤێ سیاسەتێ نووی بکەین دا ڕۆنتر یان پاراستیتر لێ بکەین. نووی کاری دێ د ناڤ ئەپی دا دیار بن. بەردەوام بوون ل سەر بکارئینانێ ڕامانا وێ ئەو کو تە مەرجێن نووی قەبویلن.\n\nپەیوەندی\n\nئەگەر تە پرسیار هەبن ل سەر تایبەتمەندیێ یان ئاسایشێ، تو دشێی پەیوەندیێ ب پاڵپشتیێ بکەی ل بەشێ \"پەیوەندیێ ب مە بکە\" د ئەپی دا."),
